import React, { useContext, useRef, useEffect } from 'react';
import { StyleSheet, View } from 'react-native';
import { useHistory } from 'react-router-native';
import { SignInWithGoogle } from '../firebase/firebaseFunctions';
import Button from './Button';
import Text from './Text';

const styles = StyleSheet.create({
  container: {
    flexDirection: 'column',
    zIndex: 1000,
  },
  button: {
    margin: 30
  },
  heading: {
    margin: 20
  }
});


const SignInPage = () => {

const history = useHistory();

const submitSignInWithGoogle = () => {
    SignInWithGoogle();
    history.push('/');
};



  return (
    <>
       <View style={styles.container}>

        <Text color={'primary'} fontSize={'heading'} fontWeight={'bold'} style={styles.heading}>
          Sign up
        </Text>

        <Button onPress={submitSignInWithGoogle} style={styles.button}>
            Sign up with google
        </Button>
        <Button onPress={() => {history.push("/sign-up-email");}} style={styles.button}>
            Sign up with Email
        </Button>
        <Button onPress={() => {console.log('facebook signup');}} style={styles.button}>
            Sign up with Facebook
        </Button>
        <Button onPress={() => {console.log('phonenumber signup');}} style={styles.button}>
            Sign up with phonenumber
        </Button>
       </View>
    </>

  );
};

export default SignInPage;
